@Override public final RLESparseResourceAllocation getEstimation(
    String pipelineId) throws SkylineStoreException {
  inputValidator.validate(pipelineId);
  readLock.lock();
  try {
    return estimationStore.get(pipelineId);
  } finally {
    readLock.unlock();
  }
}
